column1:
@1102Kanchan カンちゃん ありがとう。☺️

やっとコロナの規制がなくなって 観光バスが走っています。

今は・浜茄子・はまなす・花が綺麗だよ。☺️

@papapapanda10 コロナ罹って自宅療養中で身動き取れなかった時、初めてフードデリバリーを登録して利用しましたがメッチャ助かりましたよ。

食べ物を運んでもらう側としては、自転車でもバイクでも車でも気になりません。

ママチャリで大変な思いをして届けてくれる配達員さん、逆に感謝ですよ

