んー、どうにも3DSは生産停止になった後でコロナによる巣籠もり需要が発生してプレミア付いちゃったみたいで……(´･ω･｀)
やった事はないのですがswitchの川島先生の脳トレでも、進めると軽いワーキングメモリートレーニングなら出来るようです。

@aim36__ おおおお〜〜〜〜！！！！！
このちゃんが当たってコロナも大人しくなりますように！！まほは受験生なので塾に監禁されてきますわ😉
また感想教えてね（絶対早すぎ）

