https://t.co/nAbbze8vku

@UomoLeon いえいえーお気になさらずー

地元の行政・斑鳩町にも、あまり頼っておられず、なかな凄いと思っています

でも、コロナ禍はしんどかったんですねー

@kyoutei456 フォローさせていただきました☺️💕
