@PQDBZ @Calcijp かのワクチンでは、現在のコロナにたいしては、重症化予防効果しかないはずで、感染者が減っていることがワクチンと関連してるとはおもえませんよね。
みな、効いているつもりになってるだけでは？
わからないのですから、断定的な思考はやめた方が良いと思います。

@keiseisuzuki 藤井先生が政府関係者に確認したところ
「コロナ増税、当り前じゃないか」
と言われたそうです。

@dears_dias 良い思い?
周りはコロナに罹ってるのに
自分はコロナになってない🙄

@nikaidou495 リプ失礼します。
静岡公演希望   18（大学）長尾謙杜 ｸﾝ 担当です。
今まで当たってもコロナで行けなくなってしまっていたのでぜひ行きたいと考えております。ご検討の方よろしくお願いします。

@natsu_in28 なっちゃん💦
知らない間にコロナの疑いあったの?!
陰性で良かったね‼️

@HISASHI_0312 アメリカはコロナでどんどんお金配ったから今コロナ前より景気良くなってるよ
日本は何もしないからこんなことになってるんよ
未来へのツケは今景気を良くしない方が回っていくと思う

@syabu_o0 酔ってるよあのカスども
実際は助肋骨除去の医院持ち出してきたりするし
なによりTwitterの医者って連中は、自分の主張のためなら科学としての厳密さなんてなんとも思ってない(コロナで若い人も肺の繊維化する！と叫ぶだけでその確率とかなにも発信してなかった

@yoshi78511819 自公政権は、経団連や同友会に根ざした政党。国民から掠め取った消費税で法人税を減額。補助金で潰れる企業を助け。コロナでもゼロゼロ融資。そんな企業が賃金上げれるわけない。
日本で賃金上がらないのは、ゾンビ企業が生き残っているから。
勿論、ストしないとか、非正規が多いとかも有ります。

@miyuna_tamapuri みゆなちゃん、あつあつどん兵衛に火傷させられしまったんですか。😭
お大事になさって下さい。
全力全開ウルトラアフィリアクセスフラッシュ!

@cama_tego 大丈夫ですか？
隔離期間長いけど、頑張ってね💦
うちは、先月家族内でコロナになって,心が大変でした😥

@poku5656_na 何遍聞いても五類にすればコロナ禍が消えてなくなるファンタジー設定はわからないですね。
コロナ発症してても病院の正面から入って受付して診察受けて相部屋で入院できるようになるの？
#反ワクチン #反医療 #反知性 #ゴー宣 #コロナ論 #小林よしのり #コロナを崇めるカルト #度外れた馬鹿

@Fu2ke0 入院いつなんですか？
準備、色々とありますよね💦
コロナで面会できないから、家族に気軽にあれ持ってきて。とか言えないし💦

@n_misaki0208 なんだろうね。私は鼻と耳が繋がってる管の病気ジカンって病気になって耳の聞こえとか詰まりが良くなったら時々耳鳴りが起こるようになったけどコロナだし
詰まらないから行かない

鼻と喉近いし繋がってると思うから、そっちにも耳鼻科とアレルギーが両方診察が出来る医者かクリニックがあると良いね

@Kusunoki0538 @Magmag40887776 すみません、分かりませんよね。
キモいおっさんは僕のことです。
黒いコートを愛用してまして、メガネをかけていて昨今のコロナ禍でマスクですので、客観的に見て否定できないな、と思っています。

