@MISATO23286940 駐妻カーストね！聞いた聞いた🤣

コロナもあって、ちょっと今までの雰囲気とは変わってきてるのかね🤔
皆いい人！最高😍😍😍

@alljon12 合間合間に家事出来るので、ホントコロナ様様ですよ。
コロナ来なかったらこんな生活有り得ないです。

別に仕事も遅れる事無いですし。通勤しなくていいですし。

@kouseiyo 根性ですね。。！

強度はともかく、ストレッチが打開策になるかもという情報は自分にはありがたかったですし、少しずつですが改善してる感じもあります。

ただ、自分の場合はどうしてもワクチンやコロナスタートの疑念があり、血液の数値などがダメだと、血栓とか気になってしまって足踏みしていて、

@zaitakukeibi 早い遅いじゃなく、なんか変な感覚なのは冬開催とコロナ下のせいなんだろうなぁ・と。
始まったら始まったで楽しみはするんだろうけど。純粋にサッカーってスポーツは好きだし。
自国代表はさておき。笑

@MiyuMotohashi 私も酷い風邪ひかなかったその１人です。
コロナであろう未接種の家族の看病も、接種したあとインフルのように寝込んだお預かりしている子の看病もしましたが何も私には起きていません。
指定感染症扱いしているくらいのコロナなら私の元気はどう説明つくのかと思います。

@shimapri しまうまプリントさま
素敵なキャンペーンありがとうございます❣️
お酒の大好きな父に地酒をプレゼントします💗それと可愛がってくれている孫たちの写真をミニアルバムにして🥰コロナで会う機会が減っているので喜んでくれると思っています💫

@takavet1 登下校の見守り時、子供から、マスクは？と聞かれ、もうしなくていいんだよー、と答えると不思議そうな、驚くような顔をされました。
親が真実を知るべき。子供がマスク脳になったのは学校及び家庭内の指導の賜です。
家庭内でマスクとコロナの事実を伝えていれば子供のマスク脳は防げたはず。

@tomotsu_Mark2 ご心配お掛けしました！
イベント直後だったのでもしコロナってたらお客さんにも迷惑かけるのでは·····と嫌な汗かいてました😥😥

ほんと最近の気温差はえげつなくてポンコツ度が増す一方です。ともつさんもお気を付けて！

